INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`)
VALUES
	('node','news',0,81,81,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>Many news sites are reporting a vulnerability (dubbed the Heartbleed bug) discovered in OpenSSL, an encryption technology used by a majority of websites and online services—including banks, email providers, and social media sites—to protect sensitive data as it’s transmitted from users to web services.</p>\n\n<p>We want to emphasize that Battle.net\'s encryption was <strong>not</strong> affected by this vulnerability. However, if you use the same password on Battle.net that you use elsewhere, your Battle.net account could be at risk if those sites were affected by this bug.</p>\n\n<p>If the above situation applies to you, we recommend <a href=\"https://www.battle.net/account/support/password-reset.html\">changing your Battle.net password</a> to a new, unique password. As always, we recommend that you maintain separate login credentials for each online service you use. Using the same email or password across multiple services greatly increases the potential impact of any compromise.</p>\n\n<p>More information about the Heartbleed vulnerability can be found at <a href=\"http://heartbleed.com/\">http://heartbleed.com</a>, and you can find additional information on how to protect your Battle.net accounts at <a href=\"http://www.battle.net/security\">http://www.battle.net/security</a>.</p>\n</div>',NULL,'filtered_html'),
	('node','news',0,82,82,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>Diablo III patch 2.0.4 is now live in the Americas. Check out the full patch notes below to learn all about the latest changes.</p>\n\n<p><strong>Important:</strong> Please note that you will not be prompted to download patch 2.0.4 until the patch is live in your home region. If you are logging in from a European or Asian client, you will need to wait for this patch to release in that region before it can be installed. Additionally, if your home region is in the Americas, you will be unable to log into Europe or Asia using Global Play after patch 2.0.4 is live until those regions have also patched.</p>\n\n<p/>\n\n<h2 style=\"text-align: center;\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/YXLZOBCKC72O1393299196022.png\" style=\"width: 600px; height: 31px;\"/></h2>\n\n<p/>\n\n<h4><strong><a name=\"top\"/>Diablo III Patch 2.0.4 - v2.0.2.23119</strong></h4>\n\n<p>Visit our <a href=\"http://us.battle.net/d3/en/forum/5386229/\">Bug Report forum</a> for a list of known issues.<br/>\nFor a list of up to date hotfixes, please <a href=\"http://us.battle.net/d3/en/forum/topic/12427063132\">go here</a>.</p>\n\n<h1><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/NKPZD1ORL60Z1393361603868.png\" style=\"width: 25px; height: 25px; float: left;\"/>Table of Contents</h1>\n\n<ul>\n	<li><a href=\"#general\">General</a></li>\n	<li><a href=\"#classes\">Classes</a>\n	<ul>\n		<li><a href=\"#barb\">Barbarian</a></li>\n		<li><a href=\"#crusader\">Crusader</a></li>\n		<li><a href=\"#dh\">Demon Hunter</a></li>\n		<li><a href=\"#monk\">Monk</a></li>\n		<li><a href=\"#witchdoctor\">Witch Doctor</a></li>\n		<li><a href=\"#wizard\">Wizard</a></li>\n	</ul>\n	</li>\n	<li><a href=\"#AM\">Adventure Mode</a></li>\n	<li><a href=\"#Crafting\">Crafting</a></li>\n	<li><a href=\"#items\">Items</a></li>\n	<li><a href=\"#monsters\">Monsters</a></li>\n	<li><a href=\"#quests\">Quests</a></li>\n	<li><a href=\"#UI\">User Interface</a></li>\n</ul>\n\n<p/>\n\n<h2 style=\"text-align: center;\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/YXLZOBCKC72O1393299196022.png\" style=\"width: 600px; height: 31px;\"/></h2>\n\n<h3><strong><a name=\"general\">GENERAL</a></strong></h3>\n\n<ul>\n	<li>Greatly increased the survivability of pets summoned by several items and skills, including:\n	<ul>\n		<li>Skycutter</li>\n		<li>Maximus</li>\n		<li>The Gidbinn</li>\n		<li>Genzaniku</li>\n		<li>Litany of the Undaunted</li>\n		<li>Call of the Ancients</li>\n		<li>Falling Sword - Rise Brothers</li>\n	</ul>\n	</li>\n	<li>All Town hubs have had the placement of the Nephalem Rift Obelisk, Orek, and Kadala adjusted to help reduce the chance of accidental clicking</li>\n	<li>The Blacksmith\'s Belongings box in Act I no longer has collision</li>\n	<li>The Healing statistic on the Character screen uses new stat weighting to provide better guidance\n	<ul>\n		<li>Toughness, DPS, and Healing statistics are guideline stats. Some stats were contributing too much to the overall total, such as Life per Resource spent, and the total now should be more accurate for players who rely on these estimates for making their gearing decisions. Actual healing being provided has not been changed.</li>\n	</ul>\n	</li>\n	<li>All pets, including Witch Doctor and Demon Hunter pets, now scale their damage with Critical Hit Damage</li>\n	<li>New Paragon Portraits have been added\n	<ul>\n		<li>There are now new portraits granted for players who reach Paragon 200, 300, 400, 500, 600, 700, and 800</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"classes\">CLASSES</a></strong></h3>\n\n<ul>\n	<li><a name=\"barb\"><strong>Barbarian</strong></a>\n\n	<ul>\n		<li>Philosophy\n		<ul>\n			<li>Many skills that spend Fury feel great, but when it comes time to generate Fury the single-target options don\'t feel meaty compared to the generators that can hit more than one target at a time. As a result, we are increasing the potency of those single-target generators to be more competitive.</li>\n		</ul>\n		</li>\n		<li>Active Skills\n		<ul>\n			<li>Bash\n			<ul>\n				<li>Increased base damage from 170% to 215% weapon damage</li>\n				<li>Skill Rune - Clobber\n				<ul>\n					<li>Increased chance to stun for 1.5 seconds from 30% to 35%</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Onslaught\n				<ul>\n					<li>Increased additional damage from 80% to 100% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Frenzy\n			<ul>\n				<li>Increased base damage from 120% to 155% weapon damage</li>\n			</ul>\n			</li>\n			<li>War Cry\n			<ul>\n				<li>Bug Fix: Fixed an issue preventing the 5 seconds of paused Fury degeneration after casting War Cry from working.</li>\n			</ul>\n			</li>\n			<li>Weapon Throw\n			<ul>\n				<li>Increased base damage from 150% to 185% weapon damage</li>\n				<li>Skill Rune - Mighty Throw\n				<ul>\n					<li>Increased damage from 210% to 270% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Throwing Hammer\n				<ul>\n					<li>Increased chance to stun from 30% to 40%</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<ul>\n	<li><a name=\"crusader\"><strong>Crusader</strong></a>\n\n	<ul>\n		<li>Philosophy\n		<ul>\n			<li>Many of the Crusader\'s Wrath spenders are below where we would like, while Heaven\'s Fury - Fires of Heaven was over-performing. We are toning back Fires of Heaven while increasing the potency of most of the other Crusader spenders to encourage greater build exploration.</li>\n			<li>The single-target Wrath generator spells, Punish and Justice, don\'t feel meaty compared to generators that can hit more than one target at a time. As a result, we are increasing the potency of Punish and Justice to be more competitive.</li>\n			<li>We are making a few adjustments to improve Steed Charge. The cooldown and duration of the skill have both been reduced. Overall, this makes the total uptime for the skill slightly higher and, more importantly, you\'ll be able to hit the button more often. We\'re removing the ability for Steed Charge to break stuns, which allows us to focus on Steed Charge being primarily a mobility skill that can still get you out of root effects, such as Jailer. We still want Steed Charge to be useful in combat, so we\'re also increasing the damage on damage-focused runes.</li>\n		</ul>\n		</li>\n		<li>General\n		<ul>\n			<li>Crusaders now take 15% less damage from all sources</li>\n		</ul>\n		</li>\n		<li>Active Skills\n		<ul>\n			<li>Akarat\'s Champion\n			<ul>\n				<li>Skill Rune - Rally\n				<ul>\n					<li>Fixed an issue where Rally would not reduce the cooldown of Condemn</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Blessed Hammer\n			<ul>\n				<li>Skill Rune - Burning Wrath\n				<ul>\n					<li>Increased radius from 5 to 8 yards</li>\n					<li>Increased pool damage from 95% to 150% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Icebound Hammer\n				<ul>\n					<li>Bug Fix: Fixed an issue where Icebound Hammer wasn\'t chilling enemies</li>\n					<li>Icebound Hammer no longer goes away when exploding</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Blessed Shield\n			<ul>\n				<li>Increased base skill damage from 280% to 340% weapon damage</li>\n				<li>Skill Rune - Combust\n				<ul>\n					<li>Increased damage from 105% to 270% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Shattering Throw\n				<ul>\n					<li>Increased damage from 50% to 333% weapon damage\n					<ul>\n						<li>Known Issue: The tooltip for this skill rune does not reflect this change</li>\n					</ul>\n					</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Fist of the Heavens\n			<ul>\n				<li>Increased base skill\'s impact damage from 250% to 340% weapon damage</li>\n				<li>Increased base skill\'s bolt damage from 210% to 340% weapon damage</li>\n				<li>Skill Rune - Divine Well\n				<ul>\n					<li>Increased damage from 14% to 80% weapon damage</li>\n					<li>Increased bolt zap search radius from 12 to 18 yards</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Fissure\n				<ul>\n					<li>Increased area of effect damage from 80% to 400% weapon damage over 5 seconds</li>\n					<li>Increased Arc capsule damage radius from 3 to 6 yards</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Heaven\'s Tempest\n				<ul>\n					<li>Bug Fix: Fixed an issue where Heaven\'s Tempest was not moving around in its intended pattern</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Heaven\'s Fury\n			<ul>\n				<li>Skill Rune - Fires of Heaven\n				<ul>\n					<li>Reduced damage from 950% to 735% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Justice\n			<ul>\n				<li>Increased base skill damage from 175% to 240% weapon damage</li>\n				<li>Skill Rune - Burst\n				<ul>\n					<li>Increased damage from 25% to 30% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Hammer of Pursuit\n				<ul>\n					<li>Hammer of Pursuit now seeks targets more quickly after cast</li>\n					<li>Increased damage from 200% to 300% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Phalanx\n			<ul>\n				<li>Increased base skill damage from 295% to 380% weapon damage</li>\n				<li>Skill Rune - Bowmen\n				<ul>\n					<li>Increased damage from 85% to 160% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Bodyguard\n				<ul>\n					<li>Increased damage from 200% to 285% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Shield Charge\n				<ul>\n					<li>Increased damage from 75% to 180% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Stampede\n				<ul>\n					<li>Increased Stun chance from 25% to 30%</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Punish\n			<ul>\n				<li>Increased base skill damage from 200% to 270% weapon damage</li>\n				<li>Skill Rune - Retaliate\n				<ul>\n					<li>Increased damage from 70% to 94% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Shield Bash\n			<ul>\n				<li>Increased base skill damage from 325% to 370% weapon damage</li>\n				<li>Skill Rune - Crumble\n				<ul>\n					<li>Increased on death proc damage from 550% to 660% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Pound\n				<ul>\n					<li>Increased damage from 550% to 740% weapon damage</li>\n					<li>Increased bonus damage from shield Block Chance from 150% to 500%</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Steed Charge\n			<ul>\n				<li>Reduced base skill cooldown from 25 to 16 seconds</li>\n				<li>Reduced base skill duration from 2 to 1.5 seconds</li>\n				<li>No longer breaks Stun</li>\n				<li>Skill Rune - Endurance\n				<ul>\n					<li>Reduced duration from 3 to 2 seconds</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Ramming Speed\n				<ul>\n					<li>Increased damage from 475% to 515% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Nightmare\n				<ul>\n					<li>Bug Fix: Fixed an issue where the Fire pools were not lasting their full intended duration</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Draw and Quarter\n				<ul>\n					<li>Increased damage from 125% to 185% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Sweep Attack\n			<ul>\n				<li>Increased base damage from 400% to 440% weapon damage</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n		<li>Passive Skills\n		<ul>\n			<li>Lord Commander\n			<ul>\n				<li>Now reduces the cooldown of Steed Charge by 25% and Bombardment by 35%</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<ul>\n	<li><a name=\"dh\"><strong>Demon Hunter</strong></a>\n\n	<ul>\n		<li>Philosophy\n		<ul>\n			<li>Many skills that spend Hatred feel great, but when it comes time to generate Hatred the single-target options don\'t feel meaty compared to the generators that can hit more than one target at a time. As a result, we are increasing the potency of a few single-target generators to be more competitive.</li>\n		</ul>\n		</li>\n		<li>Active Skills\n		<ul>\n			<li>Evasive Fire\n			<ul>\n				<li>Increased base middle shot damage from 160% to 200% weapon damage</li>\n				<li>Increased base side shot damage from 80% to 100% weapon damage</li>\n				<li>Skill Rune - Covering Fire\n				<ul>\n					<li>Bug Fix: Fixed a bug causing the side shot damage to be lower than the amount listed</li>\n					<li>Increased the damage of the side shots from 160% to 200% weapon damage</li>\n					<li>Increased the range of the side shots from 50% to 80% to match the range of the middle shot</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Hungering Arrow\n			<ul>\n				<li>Increased base damage from 125% to 155% weapon damage</li>\n			</ul>\n			</li>\n			<li>Sentry\n			<ul>\n				<li>Skill Rune - Guardian Turret\n				<ul>\n					<li>The damage reduction from this rune will now be reflected in the Toughness display</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<ul>\n	<li><a name=\"monk\"><strong>Monk</strong></a>\n\n	<ul>\n		<li>Philosophy\n		<ul>\n			<li><strike>Monks are working as intended and Dashing Strike is perfectly balanced.</strike></li>\n			<li>There are no Monk changes at this time. Monks are currently in a fairly comfortable place, but as with all aspects of the game, we will continue to monitor them and make changes as needed.</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<ul>\n	<li><a name=\"witchdoctor\"><strong>Witch Doctor</strong></a>\n\n	<ul>\n		<li>Philosophy\n		<ul>\n			<li>The Witch Doctor was lacking good options for when they were low on Mana. A lack of attractive Signature spells results in builds primarily focused on sustaining Mana for long periods of time. We are increasing the potency of a few single-target Signature spells to be more competitive so that there are still aggressive options while waiting for Mana to regenerate.</li>\n			<li>Haunt has received some changes to provide a low-Mana option as well as to emphasize options for a damage-over-time (DOT) play style.</li>\n		</ul>\n		</li>\n		<li>Active Skills\n		<ul>\n			<li>Poison Dart\n			<ul>\n				<li>Increased base skill damage from 155% + 40% to 185% + 40% weapon damage</li>\n				<li>Skill Rune - Splinters\n				<ul>\n					<li>Increased damage from 65% to 105% weapon damage per dart</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Spined Dart\n				<ul>\n					<li>Increased amount of Mana returned from 25 to 50</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Flaming Dart\n				<ul>\n					<li>Increased damage from 275% to 425% weapon damage over 4 seconds</li>\n					<li>Damage over time from Flaming Dart can now stack with itself</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Snake to the Face\n				<ul>\n					<li>Stun chance increased from 25% to 33%-35%</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Corpse Spiders\n			<ul>\n				<li>Increased base skill damage from 216% to 324% weapon damage</li>\n				<li>Skill Rune - Leaping Spiders\n				<ul>\n					<li>Increased damage from 238% to 383% weapon damage</li>\n				</ul>\n				</li>\n				<li>Skill Rune - Blazing Spiders\n				<ul>\n					<li>Increased damage from 259% to 400% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Firebomb\n			<ul>\n				<li>Skill Rune - Pyrogeist\n				<ul>\n					<li>Increased damage from 560% to 880% weapon damage</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Haunt\n			<ul>\n				<li>Reduced Mana cost from 200 to 50</li>\n				<li>Increased base skill damage from 1465% over 6 seconds to 4000% over 12 seconds</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<ul>\n	<li><a name=\"wizard\"><strong>Wizard</strong></a>\n\n	<ul>\n		<li>Philosophy\n		<ul>\n			<li>Two skills on the Wizard, Arcane Orb - Frozen Orb and Electrocute, have bugs with their implementation. Unfortunately, these bug fixes do have the side effect of weakening these skills. Ultimately, this brings these skills back in line with other Wizard skills, which is why we chose to implement these fixes.</li>\n			<li>Teleport is receiving some changes to allow it to work in more situations. The range is being increased overall for each cast of Teleport. As a result, the Wormhole rune is receiving a reduction in the number of successive casts that can be completed. Previously, you could cover 140 yards in 4 casts and now you can cover 150 yards in 3 casts. Overall, this is a buff.</li>\n		</ul>\n		</li>\n		<li>Active Skills\n		<ul>\n			<li>Arcane Orb\n			<ul>\n				<li>Frozen Orb\n				<ul>\n					<li>Bug Fix: Fixed an issue where Frozen Orb was chilling for longer than intended</li>\n					<li>Bug Fix: Fixed an issue where the Frozen Orb bonus damage radius was hitting a larger area than intended</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Electrocute\n			<ul>\n				<li>Skill Rune - Surge of Power\n				<ul>\n					<li>Reduced proc scalar from 0.25 to 0.166</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n			<li>Teleport\n			<ul>\n				<li>Increased range from 35 to 50 yards</li>\n				<li>Skill Rune - Wormhole\n				<ul>\n					<li>Reduced maximum allowed teleports from 4 to 3</li>\n				</ul>\n				</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n		<li>Passive Skills\n		<ul>\n			<li>Arcane Dynamo\n			<ul>\n				<li>Bug Fix: Arcane Dynamo now properly grants bonus damage to channeled spells</li>\n			</ul>\n			</li>\n			<li>Prodigy\n			<ul>\n				<li>Bug Fix: Fixed an issue where Electrocute was granting double the intended amount of Arcane Power when used with Prodigy</li>\n			</ul>\n			</li>\n		</ul>\n		</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"AM\">ADVENTURE MODE</a></strong></h3>\n\n<ul>\n	<li><strong>Nephalem Rifts</strong>\n\n	<ul>\n		<li>Nephalem Obelisks now have a short cast time before they activate</li>\n		<li>Adjusted the potential layouts for Sewer and Aqueduct style dungeons to include more randomized options</li>\n	</ul>\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"Crafting\">CRAFTING</a></strong></h3>\n\n<ul>\n	<li>Level 70 crafted sets no longer require Flawless Royal gems and instead now require Marquise gems</li>\n	<li>The drop rate of unique Legendary crafting materials has been significantly increased\n	<ul>\n		<li>This matches the drop rate of Death\'s Breaths</li>\n	</ul>\n	</li>\n	<li>Death\'s Breaths are no longer required for level 61-70 Rare crafting recipes</li>\n	<li>Bug Fix: Legendary crafted shields now provide the correct amount of Block Value for their level</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"items\">ITEMS</a></strong></h3>\n\n<ul>\n	<li>The treasure from Resplendent Chests has been improved to feel more resplendent</li>\n	<li><strike>Bug Fix: Legendary Follower relics will no longer roll incorrect Primary stats</strike>\n	<ul>\n		<li>This bug is currently still active, and will be addressed in a future patch</li>\n	</ul>\n	</li>\n	<li>Malthael is now much more afraid, and will more consistently drop the Reaper\'s Fear Legendary crafting material</li>\n	<li>Bug Fix: Gloves of Worship no longer grant 60 minute buffs for Empowered or Fleeting Shrines</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"monsters\">MONSTERS</a></strong></h3>\n\n<ul>\n	<li>Damage from ghosts with the Soul Siphon ability has been reduced</li>\n	<li>Poison Enchanted\n	<ul>\n		<li>Duration of each Poison Enchanted globule reduced from 8 to 6 seconds.</li>\n		<li>Maximum number of Poison Enchanted globules has been reduced from 4 to 3 per cast</li>\n		<li>Poison Enchanted is now triggered with more variation in timing from Champion packs</li>\n	</ul>\n	</li>\n	<li>The \"Kill Malthael\" quest is now required to be completed before Malthael will drop loot</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"quests\">QUESTS</a></strong></h3>\n\n<ul>\n	<li>The Crazy Climber event now requires players to kill the monsters spawned during the event to complete</li>\n	<li>The Jar of Souls event now spawns additional monsters in Torment I and higher</li>\n	<li>The Matriarch\'s Bones event now spawns additional monsters in Torment I and higher</li>\n	<li>In Campaign Mode, Manglemaw now only drops loot and gives XP before the player progresses to the Chancellor\'s Tomb quest</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h3><strong><a name=\"UI\">USER INTERFACE</a></strong></h3>\n\n<ul>\n	<li>Bug Fix: Fixed an issue where game objects were prioritized over chat links in the chat window\n	</li>\n	<li>Bug Fix: Fixed an issue where players were sometimes unable to click on chat links at the bottom of the chat window\n	</li>\n	<li>Monster health totals now use commas\n	</li>\n</ul>\n\n<p><a href=\"#top\">Return to Top</a></p>\n\n<p/>\n\n<h2 style=\"text-align: center;\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/YXLZOBCKC72O1393299196022.png\" style=\"width: 600px; height: 31px;\"/></h2>\n\n<p/>\n\n<p>If you are experiencing technical issues with the patching process, connecting to Battle.net after installing the patch, or errors while playing a newly-patched game, please visit our <a href=\"http://us.battle.net/support/en/bnet/technical-support\" target=\"_blank\">support site</a> or post in the <a href=\"http://us.battle.net/d3/en/forum/5386227/\" target=\"_blank\">Technical Support forum</a> for assistance.</p>\n<style type=\"text/css\">#blog h3 { font:normal 22px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog h1 { font:normal 18px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n  #blog h4 { font:normal 26px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n#blog .divider-up { width:100%; height:72px; background:url(\'http://us.media1.battle.net/cms/gallery/MO010OF9ESV11334191716770.png?v=2\') center center no-repeat; }#blog .detail #center {\nwidth: 590px;\nmargin: 0px auto;\n}\n                  /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n  \n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,83,83,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>As the days drew ever-closer to the release of <a href=\"http://us.battle.net/d3/en/reaper-of-souls/\" target=\"_blank\">Diablo III: Reaper of Souls™</a>, artisans from around the world rallied the tools of their trade to portray the heroes of Sanctuary or Malthael preparing for the coming conflict. There were over $11,000 worth of prizes and a two-night trip to Blizzard HQ in Irvine, California up for grabs, so the competition was sure to be as fierce as any battle within the mortal realms!</p>\n\n<p>One by one, these dedicated artists tapped into their innate abilities and honed their skills, and by the time the deadline for the contest drew to a close, an incredible <strong>3,619 </strong>pieces of stunning artwork had been submitted! The sheer talent of each and every one of these artists is astounding, and we highly encourage you to feast your eyes on <a href=\"http://www.deviantart.com/contests/2014/diabloiii/\">all of the contest entries</a>.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<p>Out of the <a href=\"http://www.deviantart.com/journals/dacontests/\" target=\"_blank\">twenty-five semi-finalists</a> chosen by deviantART staff, Christian Lichtner, Art Director of Diablo III, had the arduous task of selecting three winners whose work best embodied the spirit of the contest. We are pleased to reveal the winners below!</p>\n\n<p/>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<center>\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 560px;\">\n	<tbody>\n		<tr>\n			<td style=\"text-align: center;\">\n			<h1 style=\"text-align: center;\">First Place</h1>\n\n			<p/>\n			<a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/QXND8GD1KZYJ1395160984956.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/EEA0ZPQX24UV1395160986144.jpg\" style=\"margin-left: 18px; margin-right: 18px; width: 260px; height: 390px;\"/></a><span style=\"font-size: 10px; line-height: 20px; text-align: center;\">\"</span><a href=\"http://kuzinskiy.deviantart.com/art/New-Evil-440054631\" style=\"font-size: 10px; line-height: 20px; text-align: center;\">New Evil</a><span style=\"font-size: 10px; line-height: 20px; text-align: center;\">\" by </span><a href=\"http://kuzinskiy.deviantart.com/\" style=\"font-size: 10px; line-height: 20px; text-align: center;\">Kuzinskiy Andrey (Kuzinskiy)</a></td>\n			<td style=\"text-align: center;\">\n			<h4 style=\"text-align: left;\">Kuzinskiy has won:</h4>\n\n			<ul>\n				<li style=\"text-align: left;\">A 2 night trip to Blizzard HQ in Irvine, CA to meet the artists and developers of Diablo III</li>\n				<li style=\"text-align: left;\">A framed print of the 1st place entry signed to the artist by the Diablo III Creative Team</li>\n				<li style=\"text-align: left;\">$5,000 USD</li>\n				<li style=\"text-align: left;\">Signed boxed copy of Diablo III: Reaper of Souls Collector\'s Edition</li>\n				<li style=\"text-align: left;\">8,000 deviantART Points</li>\n				<li style=\"text-align: left;\">1-year Premium Membership to deviantART.com</li>\n			</ul>\n\n			<p/>\n\n			<h4 style=\"text-align: left;\">Judge\'s comments:</h4>\n\n			<p style=\"text-align: left;\">The composition of this piece powerfully illustrates the strength of the Barbarian, at the same time the execution of the lighting and mood really sets this piece apart! Every little detail cleverly tells a story, while focusing on the epic quest the Barbarian is about to embark upon!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n</center>\n\n<p/>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<center>\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 560px;\">\n	<tbody>\n		<tr>\n			<td style=\"text-align: center;\">\n			<h1 style=\"text-align: center;\">Second Place</h1>\n\n			<p/>\n			<a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/GVO40CPLWLDJ1395160980462.jpg\" style=\"text-align: center;\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/1QO5384UTJ231395160985461.jpg\" style=\"margin-right: 18px; margin-left: 18px; width: 260px; height: 390px;\"/></a><span style=\"font-size: 10px; line-height: 20px; text-align: center;\">\"</span><a href=\"http://therafa.deviantart.com/art/Among-the-dead-440136963\" style=\"font-size: 10px; line-height: 20px; text-align: center;\">Among the Dead</a><span style=\"font-size: 10px; line-height: 20px; text-align: center;\">\" by </span><a href=\"http://therafa.deviantart.com/\" style=\"font-size: 10px; line-height: 20px; text-align: center;\">TheRafa</a></td>\n			<td style=\"text-align: center;\">\n			<h4 style=\"text-align: left;\">TheRafa has won:</h4>\n\n			<ul>\n				<li style=\"text-align: left;\">A framed print of the 2nd place entry signed to the artist by the Diablo III Creative Team</li>\n				<li style=\"text-align: left;\">$3,000 USD</li>\n				<li style=\"text-align: left;\">Signed boxed copy of Diablo III: Reaper of Souls Collector\'s Edition</li>\n				<li style=\"text-align: left;\">4,000 deviantART Points</li>\n				<li style=\"text-align: left;\">6-month Premium Membership to deviantART.com</li>\n			</ul>\n\n			<p/>\n\n			<h4 style=\"text-align: left;\">Judge\'s comments:</h4>\n\n			<p style=\"text-align: left;\">This piece has such a strong overall visual impact and mood, and strikingly captures the cusp of an epic battle about to be waged between the forces of good versus evil! Both the composition and focal area give this piece such presence!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n</center>\n\n<p/>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<center>\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 500px;\">\n	<tbody>\n		<tr>\n			<td>\n			<h1 style=\"text-align: center;\">Third Place</h1>\n\n			<p/>\n\n			<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/ABQEWD7AT8UC1395160984359.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XIDYKYDY2WOF1395160985903.jpg\" style=\"width: 560px; height: 276px;\"/></a></p>\n\n			<p style=\"text-align: center;\"><span style=\"font-size: 10px; line-height: 20px; text-align: -webkit-center;\">\"</span><a href=\"http://nixell.deviantart.com/art/Fist-of-conviction-440227725\" style=\"font-size: 10px; line-height: 20px; text-align: -webkit-center;\">Fist of Conviction</a><span style=\"font-size: 10px; line-height: 20px; text-align: -webkit-center;\">\" by </span><a href=\"http://nixell.deviantart.com/\" style=\"font-size: 10px; line-height: 20px; text-align: -webkit-center;\">Yong Jun Cho (Nixell)</a></p>\n			</td>\n		</tr>\n		<tr>\n			<td>\n			<p/>\n\n			<h4 style=\"text-align: left;\">Nixell has won:</h4>\n\n			<ul style=\"text-align: center;\">\n				<li style=\"text-align: left;\">A framed print of the 3rd place entry signed to the artist by the Diablo III Creative Team</li>\n				<li style=\"text-align: left;\">$1,000 USD</li>\n				<li style=\"text-align: left;\">Signed boxed copy of Diablo III: Reaper of Souls Collector\'s Edition</li>\n				<li style=\"text-align: left;\">4,000 deviantART Points</li>\n				<li style=\"text-align: left;\">6-month Premium Membership to deviantART.com</li>\n			</ul>\n\n			<p/>\n\n			<h4 style=\"text-align: left;\">Judge\'s comments:</h4>\n\n			<p style=\"text-align: left;\">This painting really gives such a powerful sense of the Monk\'s history and character. The lighting is beautifully executed and reinforces the focal area to capture a moment in time, with so many great little design touches throughout!</p>\n			</td>\n		</tr>\n	</tbody>\n</table>\n\n<p/>\n</center>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<p>You can check out the winners on <a href=\"http://www.deviantart.com/diabloIII-winners\">deviantART\'s announcement blog</a>, too!</p>\n\n<p>Thank you to all contest participants for your enthusiasm for Diablo III, and for being a part of our creative community! Over the next few weeks we plan to highlight even more fantastic entries from the contest, so stay tuned for the diablical revelry and make sure to check out more of the winning artists\' work in their respective galleries listed above. </p>\n\n<p><em>Have you created your own Diablo III fan art? Make sure to tell us all about it over in our <a href=\"http://us.battle.net/d3/en/forum/8705193/\">Community Creations forum</a>! </em></p>\n<style type=\"text/css\">#blog .detail img {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img, #blog .detail a img:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 23px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog h4 { font:normal 14px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }  \n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n#blog .divider-up { width:100%; height:72px; background:url(\'http://us.media1.battle.net/cms/gallery/MO010OF9ESV11334191716770.png?v=2\') center center no-repeat; }#blog .detail #center {\nwidth: 590px;\nmargin: 0px auto;\n}\n              /* SixStoneDivider */\n  #blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,84,84,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>Over 1.5 million players around the world have stopped Death since Reaper of Souls™ launched last Tuesday, March 25. To celebrate this achievement and help support your ongoing crusade against the forces of evil, all nephalem who log into Diablo III this weekend will receive a +50% bonus to XP! This bonus XP period begins in the Americas region tonight, April 4 at 5:00 p.m. PDT and ends on Monday, April 7 at 5:00 a.m. PDT.</p>\n\n<p>Thank you so much for being a hero of Sanctuary. We hope you have fun this weekend, and we\'ll see you in Westmarch!</p>\n</div>',NULL,'filtered_html'),
	('node','news',0,85,85,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>Friend request accepted! You can now chat with your Battle.net friends directly through the <a href=\"http://www.battle.net/app/\" target=\"_blank\">desktop app for Battle.net</a>.</p>\n\n<p>To get started, simply look for the <strong>Friends </strong>icon in the upper-right of Battle.net the next time you log in. Clicking the icon will open up your Battle.net friends list, where you’ll be able to see their status and access a number of handy communication tools, including:</p>\n\n<ul>\n	<li><strong>Chat with Battle.net friends.</strong> Open a chat window on your desktop. Your messages will show up in any Blizzard game your friend happens to be playing at the time.</li>\n	<li><strong>Send and accept friend requests.</strong> Click the Add a Friend button and enter your friend’s BattleTag or email address to send them a friend request, or use the new People You May Know list. You can also right-click a friend’s name for more options.</li>\n	<li><strong>Add Favorite Friends.</strong> Drag a friend’s name to the new Favorites section of your friends list, keeping your closest friends even closer.</li>\n</ul>\n\n<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/gallery/XO093UMBN7711396395135314.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/gallery/W79JCMOA60EO1396395135184.jpg\"/></a></p>\n\n<p>To customize the in-app Friends features, click the gear-shaped icon in your Friends list, or select <strong>Settings &gt; Friends &amp; Chat</strong> from the main menu. From there you\'ll be able to set which of your friends\' activities trigger pop-up notifications (toasts), determine how chat messages appear, and more.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3>Battle.net Social Features Mini-FAQ:</h3>\n\n<p><strong>Q. Can I change my online status through Battle.net?</strong><br/>\nYes, you can change your status to Online, Busy, or Away directly through the app, and your status will be reflected in all of the games you’re playing. In addition, if you update your status in-game, it will be reflected back in Battle.net.</p>\n\n<p><strong>Q. If my friend is playing multiple games, will they receive my message in every game?</strong><br/>\nYes, any message you send through the Battle.net desktop app will appear in the app along with any game that your friend is playing on Battle.net at the time. You can further configure how messages are displayed through Battle.net\'s Settings &gt; Friends &amp; Chat menu.</p>\n\n<p><strong>Q. Does Battle.net support chatting with game-specific friends (e.g. character friends in World of Warcraft or character friends in Diablo II) or World of Warcraft guild chat?</strong><br/>\nThe Battle.net desktop app only supports direct chat with BattleTag and Real ID friends. If a character friend from World of Warcraft or Diablo III attempts to message you, you will not receive any notification in the Battle.net app—just in-game.</p>\n\n<p><strong>Q. What are the different ways I can add friends via the app?</strong><br/>\nWhen you click <strong>Add a Friend</strong>, you’ll be presented with the option to send friend requests by BattleTag, by Real ID (email address), or via a new People You May Know list. The suggestions on the People You May Know List are all friends of your existing friends, sorted by how many mutual pals you already share. To manually search for potential friends you might know, you can right-click an existing friend’s name and select View Friends, and then send friend requests from there.</p>\n\n<p><strong>Q. Can I manage how I appear on other players’ Friend of Friends or People You May Know list?</strong><br/>\nYes—if you\'re using Real ID and would prefer to instead have your BattleTag displayed on Friends of Friends or People You May Know lists, you can do so through Battle.net’s Privacy settings. First, click the gear-shaped icon in your Friends list, and select <strong>Privacy Settings</strong> to go to <a href=\"https://us.battle.net/account/management/settings/change-communication.html#privacysettings\" target=\"_blank\">Battle.net account management</a>. Next, uncheck the <strong>Show my Real ID on Friends of Friends lists</strong> option and click <strong>Submit</strong>. This will make it so your BattleTag is displayed when other players view Friends of Friends lists or People You May Know lists. If you no longer wish to be friends with someone, you can right-click their name and select <strong>Remove Friend</strong>—this will make it so your names and statuses will no longer appear in each others’ friends list and Now Playing list.</p>\n\n<p><strong>Q. Can I report someone for misconduct through the app?</strong><br/>\nIf you receive an unwanted friend request, you can report it and/or block further communication from that player by clicking the ! icon in the pending request box. To report a friend who’s behaving inappropriately, right-click a friend’s name, and click <strong>Report</strong>. You’ll then be able to select the reason from a drop-down and provide additional details on the why you’re reporting the player.</p>\n\n<p><strong>Q. Are you making any changes to the Now Playing list?</strong><br/>\nIn addition to displaying which friends are currently playing the game you’ve selected, you’re now able to click on a friend’s name in the Now Playing list to start chatting with them.</p>\n<style type=\"text/css\">#blog .detail img {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img, #blog .detail a img:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 14px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog h3 { font:normal 23px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n\n\n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,86,86,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>We hope you enjoyed our April Fools\' Day jokes for 2014!  If you missed them, check out this year\'s pranks below:</p>\n\n<ul>\n	<li><a href=\"http://us.battle.net/d3/en/blog/13607363/ascend-to-victory-with-happy-reaper%E2%84%A2-4-1-2014\">Happy Reaper</a></li>\n	<li><a href=\"http://us.battle.net/sc2/en/blog/13611763/hitting-on-the-selection-of-a-name-4-1-2014\">Herald of the Stars</a></li>\n	<li><a href=\"http://us.battle.net/wow/en/blog/13474198/artcraft-remaking-the-female-draenei-4-1-2014\">New Draenei Model</a> and <a href=\"http://us.battle.net/wow/en/forum/topic/12371977139\">Fake Patch Notes</a></li>\n	<li><a href=\"http://www.heroesofthestorm.com/en-us/news/13593522/pajamathur-hero-spotlight\">Pajamathur</a></li>\n	<li><a href=\"http://www.blizzard.com/games/outcasts/\">Blizzard Outcasts: Vengeance of the Vanquished</a></li>\n</ul>\n\n<p/>\n\n<p>And so, the Blizzard Joke Squad go galumphing back whence they came, hiding amid the slithy toves that gyre and gimble in the wabe, busily plotting and scheming for the future. See you again next year!</p>\n\n<p>And just in case this year\'s dose of April Foolishness made you reminisce about any of our past exploits, you can now check out an (almost) complete history of Blizzard April fools in our <a href=\"http://us.blizzard.com/en-us/games/april-fools/\">brand-new archive page</a>. </p>\n</div>',NULL,'filtered_html'),
	('node','news',0,87,87,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>The next <em>next </em>chapter in Sanctuary\'s epic saga has been unveiled. Summon your sickles, put on your pointy hood, and get ready for <strong>Happy Reaper™</strong> —the definitive Diablo experience coming soon to web and mobile!</p>\n\n<h3>What is Happy Reaper?</h3>\n\n<p>In Happy Reaper, players take on the role of Malthael, the Angel of Death, who\'s recently returned to Sanctuary with a vengeance. With a series of well-timed mouse clicks or finger taps, you\'ll skillfully guide Malthael through a network of ancient Pandemonium ruins to collect human souls and obliterate all puny nephalem with your trusty Death Laser of Doom™.</p>\n\n<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/Z2TJGL79607G1396322870708.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/Z2TJGL79607G1396322870708.jpg\" style=\"width: 275px; height: 366px; margin-left: 10px; margin-right: 10px;\"/></a><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/0J507EEZHVBB1396322870675.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/5687QW7MCD6M1396322870713.jpg\" style=\"width: 275px; height: 366px; margin-left: 10px; margin-right: 10px;\"/></a></p>\n\n<p>Easy, right? WRONG. Happy Reaper is probably the most challenging Blizzard game you\'ve ever played. It\'s incredibly difficult to learn and almost impossible to master!</p>\n\n<p/>\n\n<h3>Feature Highlights:</h3>\n\n<ul>\n	<li>Robust, interactive storytelling allows every choice to matter in Happy Reaper. Will Malthael ascend to victory or fall into oblivion? Only you decide!</li>\n	<li>New Tapright™ technology captures your clicks and taps better than ever, offering unparalleled responsiveness and absolutely no scapegoat for your imminent failure.</li>\n	<li>An all-new, fully loaded soundscape stimulates your senses and helps you reduce stress, improve sleep, and lose weight <strong>*</strong>.</li>\n	<li>Experience the WHOOSH of every ghostly wing flap and the POW of every laser beam blast with our proprietary Dia-Bling™ FX engine.</li>\n	<li>Larger-than-life in-game collision system provides exceptional (and increasingly difficult) levels of challenge.</li>\n</ul>\n\n<p>Bursting with rich gameplay depth, hidden difficulty modes, and the most spectacular end-game content we\'ve ever seen <strong>**</strong>, Happy Reaper offers limitless hours of <s>frustration</s> enjoyment for any aspiring harbinger of death.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<p>Can\'t wait to get your hands on Happy Reaper? (Who said patience was a virtue?) Test your mettle <strong><a href=\"http://www.diablo3.com/happyreaper\" target=\"_blank\">RIGHT HERE</a></strong> on our website with an exclusive first look of the in-browser client.</p>\n\n<p>Also, be sure to stay tuned to <a href=\"http://diablo3.com\" target=\"_blank\">diablo3.com</a> for additional details about Happy Reaper including upcoming beta tests, supported browsers and mobile devices, release date and pre-order opportunities, and much more. In the meantime, happy reaping!</p>\n\n<p><strong>*</strong><span style=\"font-size:10px;\">These statements have not been evaluated by the Food and Drug Administration.</span></p>\n\n<p><strong>**</strong><span style=\"font-size:10px;\">Or at least that we\'re told. We haven’t actually made it past pillar #4. Let us know how it goes!</span></p>\n<style type=\"text/css\">#blog .detail img {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img, #blog .detail a img:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 14px \"Palatino Linotype\", \"Times\", serif; color:#548c9b; }\n#blog h3 { font:normal 23px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n\n\n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,88,88,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>They\'ve felt the cold steel of your blade so often, the pain it brings has become a comfort to them. They\'ve watched their masterful schemes brought to ruin time and time again, and yet \"surrender\" remains the one line they refuse to cross. The luck they\'ve had would make any good man bad, but still they keep going, unwavering, undeterred.</p>\n\n<p>They’re not your traditional heroes. They are survivors. They are fighters. They are Outcasts! </p>\n\n<p>And now, finally, it\'s their time to shine. </p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<p>We are proud to announce our latest project, <a href=\"http://www.blizzard.com/games/outcasts/\">Blizzard Outcasts: Vengeance of the Vanquished</a>, a fighting game for a new generation.</p>\n\n<p>Assume the mantle of our game universes\' most infamous antiheroes, bring the pain to your enemies with insanely powerful special moves, and show the world which Outcast reigns supreme!</p>\n\n<p><a href=\"http://www.blizzard.com/games/outcasts/\">Visit the official announcement website now!</a></p>\n\n<p style=\"text-align: center;\"><a href=\"http://media.blizzard.com/outcasts/media/wallpapers/reveal/epic/epic-1920x1200.jpg\" target=\"_blank\"><img alt=\"epic-1920x1200.jpg\" data-id=\"13610190\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/DBG7PAN35KFC1396321315346.jpg\"/></a>​<br/>\n<a href=\"http://media.blizzard.com/outcasts/media/wallpapers/reveal/epic/epic-1920x1200.jpg\" target=\"_blank\"><span style=\"font-size:10px;\">Download the wallpaper </span></a></p>\n<style type=\"text/css\">#blog .detail img {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img, #blog .detail a img:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 14px \"Palatino Linotype\", \"Times\", serif; color:#548c9b; }\n#blog h3 { font:normal 23px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n\n\n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,89,89,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>If you haven\'t yet digitally purchased Reaper of Souls™ from the <a href=\"https://us.battle.net/shop/en/product/diablo-iii-reaper-of-souls?utm_content=12-19-2013&amp;utm_medium=blog-posting&amp;utm_source=internal-d3site&amp;utm_campaign=d3x-presales\" target=\"_blank\">Battle.net Shop</a> or redeemed your retail game key in <a href=\"https://us.battle.net/account/management/claim-code.html\" target=\"_blank\">Account Management</a>, don\'t delay! Today is the <strong>last day</strong> to qualify for your epic pre-order bonuses including the Wings of Valor and Valla the Demon Hunter future unlock in <a href=\"http://www.heroesofthestorm.com/en-us\" target=\"_blank\">Heroes of the Storm™</a>.</p>\n\n<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/21Y417A6KGWW1396316377865.jpg\"><img alt=\"D3ROS_PreOrder_BonusItems_BlogImage.jpg\" class=\"borderImg\" data-id=\"13035321\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/21Y417A6KGWW1396316377865.jpg\" style=\"height: 298px; width: 562px;\"/></a></p>\n\n<p>Looking to loot these glorious goodies? Then be sure to purchase a digital copy of Reaper of Souls or claim your game key by <strong>11:59 PM PDT this evening (March 31)</strong>, or else your pre-order loot will be consumed by the fires of the Burning Hells and lost forever.</p>\n\n<p>For more information about these bonuses, <a href=\"http://us.battle.net/d3/en/blog/13032539\" target=\"_blank\">click here</a>. To learn how to retrieve your Wings of Valor once claimed, <a href=\"http://us.battle.net/d3/en/blog/13407835\" target=\"_blank\">click here</a>.</p>\n\n<p>Happy hunting, nephalem!</p>\n<style type=\"text/css\">#blog .detail img.borderImg {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img.borderImg, #blog .detail a img.borderImg:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 13px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog h3 { font:normal 20px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n\n\n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,90,90,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>Players who\'ve already explored their <a href=\"http://us.battle.net/d3/en/blog/12653569\" target=\"_blank\">Collector\'s Edition goodies</a> may have noticed a small note in the back of the official Reaper of Souls™ art book referencing a mysterious new app called the <strong>Blizzard®​ AR Viewer</strong>.</p>\n\n<p>So, what is the Blizzard AR Viewer, where can you get download the app, and how does it work? Read on below for all the delicious details!</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3>What is the Blizzard AR Viewer?</h3>\n\n<p>The Blizzard AR Viewer is a free mobile application that interacts with select pages of the official Reaper of Souls Collector\'s Edition art book. This fun app allow players to take their viewing experience to the next level by bringing a series of exclusive images in the book to life through the magic of augmented reality and animation!</p>\n\n<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/SWREX214IODE1395871242870.PNG\"><img alt=\"Bog%20Brute%20and%20Ranged%203_thumb.png\" data-id=\"13514101\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/F0F80FQHY5081395873622010.png\" style=\"margin-left: 10px; margin-right: 10px;\"/></a><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/H1RJFDR7YVHG1395881928879.PNG\"><img alt=\"Bog%20Brute%20and%20Ranged_thumb.png\" data-id=\"13514100\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/CU1VIHRLNNW01395873620111.png\" style=\"margin-left: 10px; margin-right: 10px;\"/>​</a></p>\n\n<p/>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3>Where to Download the App:</h3>\n\n<p>Before you can explore these hidden art book treasures, you\'ll first need to download the Blizzard AR Viewer on your favorite iOS® or Android™ device. The app is available on the following platforms in all regions where the Apple® App Store™ and Google Play™ are available:</p>\n\n<ul>\n	<li><a href=\"https://itunes.apple.com/us/app/blizzard-ar-viewer/id836370219?ls=1&amp;mt=8\" target=\"_blank\">Apple iOS</a>\n\n	<ul>\n		<li>Recommended devices: iPhone 4S, iPhone 5, iPhone 5S, iPhone 5C, iPad 3, iPad 4</li>\n		<li>Minimum requirements: iPad 2, iPhone 4</li>\n	</ul>\n	</li>\n	<li><a href=\"http://play.google.com/store/apps/details?id=com.blizzard.blizzardarviewer\" target=\"_blank\">Android</a>\n	<ul>\n		<li>Recommended devices: Any Android 4.0 device or above</li>\n	</ul>\n	</li>\n</ul>\n\n<p>The Blizzard AR Viewer is completely free, so just select your preferred platform above, download the application, and you’re ready to go! (Please note that an active internet connection will be required to use the app itself.)</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3>How it Works:</h3>\n\n<p>Using the Blizzard AR Viewer is quick and easy. Just fire up the app on your supported mobile device, point, and scan! </p>\n\n<div class=\"centered\" style=\"margin-bottom: 25px; text-align: center;\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"http://www.youtube.com/embed/fHvET-SwiGI?theme=light&amp;color=white&amp;cc_load_policy=1&amp;HD=1&amp;rel=0&amp;showinfo=0\" style=\"border-bottom:1px solid lightgray;\" width=\"560\"/></div>\n\n<div>When navigating through the Reaper of Souls art book, be sure to keep an eye out for this <a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/6Y7UPAL8ZCZ91395879245249.png\">Malthael-inspired icon</a> on several of its pages. The icon indicates bonus content is available that\'s compatible with the AR app. </div>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3>Test Drive the Blizzard AR  Viewer Today!</h3>\n\n<p>No Collector\'s Edition? No problem! To try out the app, follow these simple instructions:</p>\n\n<ol>\n	<li>Visit <a href=\"http://media.blizzard.com/d3/pdf/arviewer/BlizzARViewerRoS.pdf\" target=\"_blank\">this link </a>and download the PDF (also available below).</li>\n	<li>Print out a color or black &amp; white copy of each image.</li>\n	<li>Use the Blizzard AR Viewer to scan the image with your device. </li>\n</ol>\n\n<p>Enjoy!</p>\n\n<p style=\"text-align: center;\"><a href=\"http://media.blizzard.com/d3/pdf/arviewer/BlizzARViewerRoS.pdf\" target=\"_blank\"><img alt=\"arimage_thumb.png\" class=\"borderImg\" data-id=\"13514104\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/4ZHDC9VT3JRM1395877461554.png\" style=\"width: 571px; height: 693px;\"/></a></p>\n<style type=\"text/css\">#blog .detail img {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img, #blog .detail a img:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 14px \"Palatino Linotype\", \"Times\", serif; color:#548c9b; }\n#blog h3 { font:normal 23px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n\n\n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','news',0,91,91,'und',0,'<div xmlns=\"http://www.w3.org/1999/xhtml\"><p>I do hope you have been making the best of your time, nephalem, because the sands in your hourglass have run out. The time has come for my master to sweep clean the streets of Westmarch, and your feeble efforts will mean little against our inevitable tide.</p>\n\n<p>Today marks the arrival of Reaper of Souls™, and though there is much to explore and possibly aid you on your futile quest, I expect you to achieve little more than a swift and painful demise.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3 style=\"text-align: center;\">Fresh Blood</h3>\n\n<h1 style=\"text-align: center;\">- The Crusader -</h1>\n\n<p>Taking on Death itself requires more than flashy spells, endless ammunition, and brute strength. If you are not confident in your current skills, perhaps you should look at other endeavors. Though I doubt the layers of armor and power of your feeble Light will stand against my blade, it is, perhaps, a good place to start.</p>\n\n<div class=\"centered\" style=\"margin-bottom: 25px; text-align: center;\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"http://www.youtube.com/embed/wZJh2fHi1Zg?theme=light&amp;color=white&amp;cc_load_policy=1&amp;HD=1&amp;rel=0&amp;showinfo=0\" style=\"border-bottom:1px solid lightgray;\" width=\"560\"/></div>\n\n<p><a href=\"http://us.battle.net/d3/en/class/crusader/\" target=\"_blank\">The Crusader</a> is the latest nephalem to challenge my lord. If you feel up to the task, you may consider taking up a flail and shield. But be advised—the path of the Crusader is a demanding one, and <a href=\"http://us.battle.net/d3/en/calculator/crusader\">plotting out your skills</a> and learning as much as possible <a href=\"http://us.battle.net/d3/en/class/crusader/\">about your Order</a> would be wise. Catching you unawares would make my job far too easy.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3 style=\"text-align: center;\">Welcome to Death\'s Lair</h3>\n\n<h1 style=\"text-align: center;\">- Exploring Act V -</h1>\n\n<p>The siege has already begun, and you, my dear heroes, are late to the party. Challenge my brothers and sisters in <a href=\"http://us.battle.net/d3/en/blog/11364551\">Westmarch</a> if you dare, but be aware—we will not fall easily.</p>\n\n<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/2W9A3J2O92VF1395557353281.jpg\"><img alt=\"Westmarch_LH_017_thumb.jpg\" data-id=\"13446206\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/VHCN9SFPRMMB1395557353183.jpg\" style=\"height: 102px; width: 181px;\"/></a><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/ISZ3WAJT4O7F1395557353337.jpg\"><img alt=\"Dx3_1_BloodMarsh_Enviro_AXE_AD_05_thumb.jpg\" data-id=\"13446207\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/LRP66Q13KUNP1395557353242.jpg\" style=\"height: 102px; width: 181px; margin-left: 10px; margin-right: 10px;\"/></a><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/KI0AT4IFOLZA1395557353398.jpg\"><img alt=\"Siege_Outpost_LH_003_thumb.jpg\" data-id=\"13446210\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/BUFN16FE6LXZ1395557353576.jpg\" style=\"height: 102px; width: 181px;\"/></a></p>\n\n<p>Doubtful as your success may be, Malthael lies far beyond the city\'s walls and you will have to traverse the deadly <a href=\"http://us.battle.net/d3/en/blog/13120786\">Blood Marsh</a> before catching even a glimpse of possible victory. If it comes to pass that you find yourself face to face with my master on <a href=\"http://us.battle.net/d3/en/blog/13370215/\">forgotten and distant battlefields</a>, well… I wish you the best of luck. You will need it.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3 style=\"text-align: center;\">Train Up</h3>\n\n<h1 style=\"text-align: center;\">- Beyond Level 60 -</h1>\n\n<p>Fortunately for you, it seems the time has come to shed your current constraints and grow further in power. Though it matters not, reaching the exalted 70<sup>th</sup> level of experience offers powers beyond your wildest imaginations. New skills are available for each brave warrior who rises to the challenge, and I dare say these impressive feats might provide a smidgen of advantage.</p>\n\n<h3 style=\"font-size: 27px; text-align: center;\"><a href=\"http://us.battle.net/d3/en/class/barbarian/active/avalanche\" target=\"_blank\"><img alt=\"\" src=\"http://media.blizzard.com/d3/icons/skills/64/x1_barbarian_avalanche_v2.png\" style=\"width: 64px; height: 64px;\"/></a> <a href=\"http://us.battle.net/d3/en/class/demon-hunter/active/vengeance\" style=\"font-size: 25px;\" target=\"_blank\"><img alt=\"\" src=\"http://media.blizzard.com/d3/icons/skills/64/x1_demonhunter_vengeance.png\" style=\"width: 64px; height: 64px;\"/></a> <a href=\"http://us.battle.net/d3/en/class/monk/active/epiphany\" style=\"font-size: 25px;\" target=\"_blank\"><img alt=\"\" src=\"http://media.blizzard.com/d3/icons/skills/64/x1_monk_epiphany.png\" style=\"width: 64px; height: 64px;\"/></a> <a href=\"http://us.battle.net/d3/en/class/witch-doctor/active/piranhas\" style=\"font-size: 25px;\" target=\"_blank\"><img alt=\"\" src=\"http://media.blizzard.com/d3/icons/skills/64/witchdoctor_piranhas.png\" style=\"width: 64px; height: 64px;\"/></a> <a href=\"http://us.battle.net/d3/en/class/wizard/active/black-hole\" style=\"font-size: 25px;\" target=\"_blank\"><img alt=\"\" src=\"http://media.blizzard.com/d3/icons/skills/64/x1_wizard_wormhole.png\" style=\"width: 64px; height: 64px;\"/></a></h3>\n\n<p>But do not take my word alone, as you may wish to try <a href=\"http://us.battle.net/d3/en/class/barbarian/active/avalanche\">Avalanche</a>, <a href=\"http://us.battle.net/d3/en/class/demon-hunter/active/vengeance\">Vengeance</a>, <a href=\"http://us.battle.net/d3/en/class/monk/active/epiphany\">Epiphany</a>, <a href=\"http://us.battle.net/d3/en/class/witch-doctor/active/piranhas\">Piranhas</a>, and <a href=\"http://us.battle.net/d3/en/class/wizard/active/black-hole\">Black Hole</a> for yourselves. I wholeheartedly advise becoming intimately familiar with these skills before employing them—I do not require further reason to regard you as fools.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3 style=\"text-align: center;\">Beyond Death’s Grasp</h3>\n\n<h1 style=\"text-align: center;\">- Adventure Mode -</h1>\n\n<p>Hypothetically speaking, let us imagine for a moment you surpass all odds and save the world. What is a hero who has defeated the embodiment of Death to do? An <a href=\"http://us.battle.net/d3/en/game/guide/gameplay/adventure-mode\">infinite wealth of challenges</a> lie beyond my master\'s defeat, should you prove worthy. That traitorous Tyrael might have the odd job or two for you, and ancient tales speak of challenges meant only for the most powerful of nephalem.</p>\n\n<div class=\"centered\" style=\"margin-bottom: 25px; text-align: center;\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"http://www.youtube.com/embed/QfXYb6WdamU?theme=light&amp;color=white&amp;cc_load_policy=1&amp;HD=1&amp;rel=0&amp;showinfo=0\" style=\"border-bottom:1px solid lightgray;\" width=\"560\"/></div>\n\n<p>Of course, that would not be you, so I would not concern yourselves with such hearsay.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3 style=\"text-align: center;\">Get All the Help You Can Get</h3>\n\n<h1 style=\"text-align: center;\">- The Mystic -</h1>\n\n<p>It is unavoidable that you will struggle along your journey. Somehow, fate has looked kindly upon your unfortunate soul and guided the <a href=\"http://us.battle.net/d3/en/artisan/mystic/\" target=\"_blank\">powerful </a><a href=\"http://us.battle.net/d3/en/blog/11337855\">Mystic</a> to cross your path. Myriam is a stubborn ant who will not be stomped, despite my best efforts. Find her, and she may be grateful enough to enchant your equipment with more powerful abilities.</p>\n\n<p style=\"text-align: center;\"><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/UA4O001DIW901382458928485.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/AGKGL31TI53C1382459778723.jpg\" style=\"width: 275px; height: 143px; margin-left: 5px; margin-right: 5px;\"/></a><a class=\"lightbox\" href=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/CKGQRVWU14BM1382581774416.jpg\"><img alt=\"\" src=\"https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/V65IZN3EOWML1382581774367.jpg\" style=\"width: 275px; height: 143px; margin-left: 5px; margin-right: 5px;\"/></a></p>\n\n<p>Of course, arrogant nephalem like you may find little need for more power, and instead may partake in frivolities such as ensuring your boots match your shoulder pads. Luckily, the Mystic will humor you in such ridiculous endeavors... for the appropriate coin.</p>\n\n<hr class=\"sixstonehr\"/>\n<p/>\n\n<h3 style=\"text-align: center;\">No One Can Stop Death</h3>\n\n<h1 style=\"text-align: center;\">- But You’re Welcome to Try -</h1>\n\n<p>I do hope my insights have proven helpful, adventurers. Whilst it is fated we meet one another on the battlefield, understand that my advice comes not from a place of good will. You are, after all, standing in opposition to my dear Angel of Death, and I am nothing if not a devoted servant.</p>\n\n<div class=\"centered\" style=\"margin-bottom: 25px; text-align: center;\"><iframe allowfullscreen=\"\" frameborder=\"0\" height=\"315\" src=\"http://www.youtube.com/embed/juT-1ew-ffc?theme=light&amp;color=white&amp;cc_load_policy=1&amp;HD=1&amp;rel=0&amp;showinfo=0\" style=\"border-bottom:1px solid lightgray;\" width=\"560\"/></div>\n\n<p>Fare thee well, nephalem. I look forward to claiming your soul.</p>\n<style type=\"text/css\">#blog .detail img {\n-moz-border-radius:4px;\n-webkit-border-radius:4px;\nborder-radius:4px;\n-moz-box-shadow:0 0 20px #000000;\n-webkit-box-shadow:0 0 20px #000000;\nbox-shadow:0 0 20px #000000;\nborder: 1px solid #300E0D;\nmax-width: 591px !important;\npadding: 1px;\n}\n#blog .detail td:hover &gt; a img, #blog .detail a img:hover {\nborder: 1px solid #BA5E0B;\n}\n#blog h1 { font:normal 14px \"Palatino Linotype\", \"Times\", serif; color:#548c9b; }\n#blog h3 { font:normal 25px \"Palatino Linotype\", \"Times\", serif; color:#F3E6D0; }\n#blog .divider-down { width:100%; height:72px; background:url(\'http://us.media3.battle.net/cms/gallery/KKZW0YDVPDT91334191716743.png?v=2\') center center no-repeat; }\n\n\n                /* SixStoneDivider */\n#blog .detail hr.sixstonehr {\n	width:100%; \n	height: 50px; \n	background:url(\'https://bnetcmsus-a.akamaihd.net/cms/content_folder_media/XVZ5EJCXP7FB1372898195077.png\') center center no-repeat; \n	border: none;\n	margin-top: 0px;\n	margin-bottom: 0px;\n  }\n</style>\n</div>',NULL,'filtered_html'),
	('node','frontpage_slide',0,103,103,'und',0,'<p>Impenetrable armor, gleaming weapons, and heavy, heavy damage–wield the power of the Crusader, unbreakable new hero of the mortal realms.</p>','','filtered_html'),
	('node','frontpage_slide',0,104,104,'und',0,'<p>The Prime Evil rages within the Black Soulstone, its essence screaming for vengeance and release. Before the artifact can be sealed away forever, Malthael–Angel of Death–manifests in the mortal realms with a deadly new purpose: to steal the Black Soulstone and bend its infernal power to his will.</p>','','filtered_html'),
